ttps:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u0437\u0430\u0432\u043e\u0434 \u00ab\u041a\u043e\u043c\u0438\u043d\u0442\u0435\u0440\u043d\u00bb \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0435 20 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0442\u0435\u043b\u0435\u0432\u0438\u0437\u043e\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B6%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BA%D0%BD%D0%B8%D0%B3_%D0%B2_%D0%BD%D0%B0%D1%86%D0%B8%D1%81%D1%82%D1%81%D0%BA%D0%BE%D0%B9_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0421\u043e\u0436\u0436\u0435\u043d\u0438\u0435 \u043a\u043d\u0438\u0433 \u0432 \u043d\u0430\u0446\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\">\u0441\u043e\u0436\u0436\u0435\u043d\u0438\u0435 \u043a\u043d\u0438\u0433<\/a> \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b-\u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u0430\u043c\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0435\u0435 \u043d\u0430\u0447\u0430\u043b\u043e \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u043c\u0443 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u044e \u043a\u043d\u0438\u0433, \u043f\u0440\u043e\u0442\u0438\u0432\u043d\u044b\u0445 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u043c\u0443 \u0434\u0443\u0445\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>:<ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3_VI\" title=\"\u0413\u0435\u043e\u0440\u0433 VI\">\u0413\u0435\u043e\u0440\u0433 VI<\/a> \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e, \u0432 \u0441\u0432\u044f\u0437\u0438 \u0441 \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u044b\u043c\u0438 \u043e\u0431\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u043c\u0438, \u043d\u0430\u0437\u043d\u0430\u0447\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D1%87%D0%B8%D0%BB%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u0427\u0435\u0440\u0447\u0438\u043b\u043b\u044c\">\u0427\u0435\u0440\u0447\u0438\u043b\u043b\u044f<\/a> \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c.<\/li><li>\u041d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D1%84%D1%82%D0%B2%D0%B0%D1%84%D1%84%D0%B5\" title=\"\u041b\u044e\u0444\u0442\u0432\u0430\u0444\u0444\u0435\">\u0432\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b<\/a> \u0431\u043e\u043c\u0431\u0438\u043b\u0438 \u043f\u043e \u043e\u0448\u0438\u0431\u043a\u0435 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%B9%D0%B1%D1%83%D1%80%D0%B3-%D0%B8%D0%BC-%D0%91%D1%80%D0%B0%D0%B9%D1%81%D0%B3%D0%B0%D1%83\" title=\"\u0424\u0440\u0430\u0439\u0431\u0443\u0440\u0433-\u0438\u043c-\u0411\u0440\u0430\u0439\u0441\u0433\u0430\u0443\">\u0424\u0440\u0430\u0439\u0431\u0443\u0440\u0433<\/a> (Bombing of Freiburg on 10 May 1940); 57 \u0436\u0435\u0440\u0442\u0432.<\/li><li>\u041d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043d\u0430 \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u043c \u0444\u0440\u043e\u043d\u0442\u0435 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u043d\u0430 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u043e\u0432 (\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435, \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435, \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0435 \u0438 \u0431\u0435\u043b\u044c\u0433\u0438\u0439\u0441\u043a\u0438\u0435 \u0447\u0430\u0441\u0442\u0438). \u041d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u043e \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u043c \u0438 \u0441\u0442\u0430\u043b\u043e \u043f\u0440\u0438\u043c\u0435\u0440\u043e\u043c \u043e\u0431\u0440\u0430\u0437\u0446\u043e\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B8%D1%86%D0%BA%D1%80%D0%B8%D0%B3\" title=\"\u0411\u043b\u0438\u0446\u043a\u0440\u0438\u0433\">\u0431\u043b\u0438\u0446\u043a\u0440\u0438\u0433\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>:<ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%81%D1%81,_%D0%A0%D1%83%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0435\u0441\u0441, \u0420\u0443\u0434\u043e\u043b\u044c\u0444\">\u0420\u0443\u0434\u043e\u043b\u044c\u0444 \u0413\u0435\u0441\u0441<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0435\u043b\u0451\u0442 \u0432 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044e \u0434\u043b\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043c\u0438\u0440\u043d\u044b\u0445 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u043e\u0432 \u043c\u0435\u0436\u0434\u0443 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439 \u0438 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439.<\/li><li>\u041d\u0430 \u0440\u0435\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u043c \u0438\u0441\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0435 \u041c\u0435\u0441\u0441\u0435\u0440\u0448\u043c\u0438\u0442\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Messerschmitt_Me.163_Komet\" title=\"Messerschmitt Me.163 Komet\">Me.163<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0435\u043e\u0434\u043e\u043b\u0451\u043d \u0440\u0443\u0431\u0435\u0436 1000 \u043a\u043c\/\u0447. \u0422\u043e\u0447\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b\u0430 1003,9 \u043a\u043c\/\u0447. \u0420\u0435\u043a\u043e\u0440\u0434 \u043f\u0440\u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0441\u044f \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947 \u0433\u043e\u0434\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0432\u0435\u0440\u0445\u043d\u0438\u0445 \u0441\u043b\u043e\u0451\u0432 \u0430\u0442\u043