8\u043b, \u0447\u0442\u043e \u0421\u0428\u0410 \u0445\u043e\u0442\u044f\u0442 \u00ab\u043f\u0440\u0438\u0441\u0432\u043e\u0438\u0442\u044c\u00bb \u0438\u0440\u0430\u043a\u0441\u043a\u0443\u044e \u043d\u0435\u0444\u0442\u044c.<\/li><li>\u0412 \u0422\u0435\u0430\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435 \u043d\u0430 \u0414\u0443\u0431\u0440\u043e\u0432\u043a\u0435 \u043c\u044e\u0437\u0438\u043a\u043b \u00ab\u041d\u043e\u0440\u0434-\u041e\u0441\u0442\u00bb \u0434\u0430\u043b \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0435. \u041d\u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 411 \u0441\u043f\u0435\u043a\u0442\u0430\u043a\u043b\u044c \u0431\u044b\u043b\u0438 \u043f\u0440\u043e\u0434\u0430\u043d\u044b \u0432\u0441\u0435 1100 \u0431\u0438\u043b\u0435\u0442\u043e\u0432.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005_%D0%B3%D0%BE%D0%B4\" title=\"2005 \u0433\u043e\u0434\">2005<\/a>&#160;\u2014 \u043f\u043e\u043f\u044b\u0442\u043a\u0430 \u0442\u0435\u0440\u0430\u043a\u0442\u0430 \u043d\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u0421\u0432\u043e\u0431\u043e\u0434\u044b \u0432 \u0422\u0431\u0438\u043b\u0438\u0441\u0438. \u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0438\u043d \u0413\u0440\u0443\u0437\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%83%D1%82%D1%8E%D0%BD%D1%8F%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u0440\u0443\u0442\u044e\u043d\u044f\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0410\u0440\u0443\u0442\u044e\u043d\u044f\u043d<\/a> \u0431\u0440\u043e\u0441\u0438\u043b \u0433\u0440\u0430\u043d\u0430\u0442\u0443 \u0432 \u0441\u0442\u043e\u0440\u043e\u043d\u0443 \u0442\u0440\u0438\u0431\u0443\u043d\u044b, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%88,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%A3%D0%BE%D0%BA%D0%B5%D1%80\" title=\"\u0411\u0443\u0448, \u0414\u0436\u043e\u0440\u0434\u0436 \u0423\u043e\u043a\u0435\u0440\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u0443\u0448<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B0%D0%BA%D0%B0%D1%88%D0%B2%D0%B8%D0%BB%D0%B8,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%BE%D0%B7%D0%BE%D0%B2%D0%B8%D1%87\" class=\"mw-redirect\" title=\"\u0421\u0430\u0430\u043a\u0430\u0448\u0432\u0438\u043b\u0438, \u041c\u0438\u0445\u0430\u0438\u043b \u041d\u0438\u043a\u043e\u043b\u043e\u0437\u043e\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0430\u0430\u043a\u0430\u0448\u0432\u0438\u043b\u0438<\/a>. \u0413\u0440\u0430\u043d\u0430\u0442\u0430 \u043d\u0435 \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0430\u0441\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a>&#160;\u2014 \u0410\u043a\u0442\u0438\u0432\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043b\u0441\u044f \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0439 \u0432\u0443\u043b\u043a\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0415\u0432\u0440\u043e\u043f\u044b<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%82%D0%BD%D0%B0\" title=\"\u042d\u0442\u043d\u0430\">\u042d\u0442\u043d\u0430<\/a>. \u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0435 \u043a\u0440\u0443\u043f\u043d\u043e\u0435 \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2